						where b.left_code=s.m2  and b.import_no= v_improtno;
				
			END IF;
			
			ELSEIF updatetype = 5 THEN
			IF
				codetype = 0 THEN
				
					update  t_ser_goods_info s ,t_ser_code_import_temp_info b set s.m5=b.left_code  
						where b.right_code=s.m2  and b.import_no= v_improtno;
						
