-- ----------------------------
-- Procedure structure for p_update_goods_m
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_update_goods_m`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_update_goods_m`()
BEGIN
	DECLARE
		done INT DEFAULT FALSE;-- 自定义控制游标循环变量,默认false
/*定义临时表游标*/
	DECLARE
		v_left_code VARCHAR ( 1024 );
	DECLARE
		v_right_code VARCHAR ( 1024 );
	DECLARE
		v_left_code_type INT;
	DECLARE
		v_right_code_type INT;
	DECLARE
		resSql VARCHAR ( 2000 );
	DECLARE
		tempCur CURSOR FOR SELECT
		left_code,
		right_code,
		left_code_type,
		right_code_type 
	FROM
		t_ser_code_import_temp_info;
	DECLARE
		CONTINUE HANDLER FOR NOT FOUND 
		SET done = TRUE;-- 绑定控制变量到游标,游标循环结束自动转true
#打开游标执行更新
	OPEN tempCur;
/*打开游标*/
	myLoop :
	LOOP-- 开始循环体,myLoop为自定义循环名,结束循环时用到
		FETCH tempCur INTO v_left_code,
		v_right_code,
		v_left_code_type,
		v_right_code_type;
		IF
			done THEN-- 判断是否继续循环
				LEAVE myLoop;-- 结束循环
			
		END IF;
		IF
			v_right_code_type < v_left_code_type THEN
				
				SET resSql = CONCAT( 'update  t_ser_goods_info set m', v_left_code_type, '=''', v_left_code, ''' where m', v_right_code_type, '=''', v_right_code, '''' );
			ELSE 
				SET resSql = CONCAT( 'update  t_ser_goods_info set m', v_right_code_type, '=''', v_right_code, ''' where m', v_left_code_type, '=''', v_left_code, '''' );
			
		END IF;
		
		SET @MyQuery = resSql;
		PREPARE MSQL 
		FROM
			@MyQuery;
		EXECUTE MSQL;
		
	END LOOP myLoop;-- 结束自定义循环体
	CLOSE tempCur;

END;
;;
delimiter ;

-- ----------------------------
-- Procedure structure for P_UPD_CommonM
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_UPD_CommonM`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `P_UPD_CommonM`()
BEGIN
	DECLARE
		flag INT DEFAULT TRUE;#声明一个开关变量flag用于循环结束判断默认是true;
	DECLARE
		v_imortno VARCHAR ( 255 );
	DECLARE
		v_left_code_type INT;
	DECLARE
		v_right_code_type INT;
	DECLARE
		v_orderno INT;
	DECLARE
		cur_param CURSOR FOR SELECT DISTINCT
		a.import_no,
		a.left_code_type,
		a.right_code_type,
		a.orderno
	FROM
		t_ser_code_import_temp_info a 
	ORDER BY
		a.orderno;
		# declare cur_param1 cursor for  select   DISTINCT a.importno,a.left_code_type,a.right_code_type  from t_ser_code_import_temp_info a,t_ser_code_import_temp_info b
		#	where  b.importno =v_imno and ( (a.left_code =b.right_code  and  a.right_code_type>updatetype) or
		# (a.right_code =b.right_code  and a.left_code_type>updatetype ));
	DECLARE
		CONTINUE HANDLER FOR NOT found 
		SET flag = FALSE;
	OPEN cur_param;#打开游标
	REPEAT
			FETCH cur_param INTO v_imortno,
			v_left_code_type,
			v_right_code_type,
			v_orderno;#把游标的内容赋值到变量中。
		CALL P_UPDAEGOODS2 ( v_imortno, v_left_code_type, v_right_code_type );
		COMMIT;
		UNTIL flag = FALSE 
	END REPEAT;
-- 	CLOSE cur_param;#删除临时表数据
	CALL P_DELTEMPS ( );

END;
;;
delimiter ;

-- ----------------------------
-- Function structure for rand_float
-- ----------------------------
DROP FUNCTION IF EXISTS `rand_float`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `rand_float`(start_num FLOAT,
    end_num FLOAT) RETURNS float
BEGIN
    DECLARE  V_SDATA1 VARCHAR(10000); #布奖类型  HB 红包  PT 积分

    RETURN convert(FLOOR(round(start_num*100,0) + RAND() * (round(end_num*100,0) - round(start_num*100,0) + 1)) 
		, DECIMAL )/100;
END;
;;
delimiter ;

-- ----------------------------
-- Function structure for rand_num
-- ----------------------------
DROP FUNCTION IF EXISTS `rand_num`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `rand_num`(start_num INTEGER,
    end_num INTEGER) RETURNS int(11)
BEGIN
    RETURN FLOOR(start_num + RAND() * (end_num - start_num + 1));
END;
;;
delimiter ;

